import './LogIn.css';
import { useState } from 'react';

function LogIn() {
  const [handleSubmit, setHandleSubmit] = useState("hej");
  const [formData, setFormData] = useState({
    email:'',
    password:''
  });

  const handleChange = ((e) => {
      const { name, value } = e.target;
      setFormData({ ...formData, [name]: value });
  });


  return (
    <>
      <div className='login'>
        <div className='login-window'>
          <div className='login-greeting'>
            <h2>Welcome back!</h2>
            <h3>We're glad to see you back</h3>
            <p>ZEROTO60S wants to become an international Auction player in the leisure, retail and adjacent sector.</p>
          </div>
          <form className="login-form" onSubmit={handleSubmit}>
            <label className='login-labels'>
              <p>Email</p>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </label>
            <label className='login-labels'>
              <p>Password</p>
              <input
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                required
              />
            </label>
            <div className='login-login-button'>
              <button type="submit">Log In</button>
            </div>
            <div className='login-register'>
              <a href="signup">Dont have an account? Register here!</a>
            </div>
            </form>
        </div>
      </div>
    </>
  );
}

export default LogIn;
